bio:
Battle-tested software developer and a Team Lead with almost 10 years of professional experience.

I pride myself on having deep knowledge on the aspects of my work and knowing exactly how to apply it - every framework, every language, every process I deal with, I learn to know deeply and thoroughly.
My approach to work is that of a calculated risk - a balance between innovative and time-proven solutions - which has proven effective for multiple startups I worked at to skyrocket any project from an idea to MVP to wide market adoption.

My github: github.com/raiondesu 

I have a rich and multifaceted experience in:
- Leading small teams of developers with different backgrounds;
- Taking projects from planning stage to release efficiently;
- Creating all sorts of websites and apps: from static landing pages to complex PWAs;
- Working with and contributing to open-source software.

Python, Java, C++;

Hard skills: math, programming, logic, tutoring, physics;

Soft skills: team-lead, time-management, extraverted.
